import { Table, Pagination, Button, Input, Form, Select ,Space, notification } from "antd";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import { Layout } from "antd";
import { Typography , Modal} from "antd";
import "./style.css";
import React, { useState, useEffect } from "react";
import axios from "axios";
import moment from "moment";

import { EditTwoTone, DeleteTwoTone } from "@ant-design/icons";

const { Option } = Select;
const { Title } = Typography; 
const { Content } = Layout;
const layout = {
  labelCol: { span: 8 },
  wrapperCol: { span: 16 },
};


function NVQLK() {
    const [listNhanVien, setListNhanVien] = useState([]);
    const [NhanVien, setNhanVien] = useState({})
    const [editVisible, setEditVisible] = useState(false);
    const [addVisible, setAddVisible] = useState(false);
    let dataW = JSON.parse(window.localStorage.getItem("auth"));
    const info = {
      MaNV: dataW.MaNV,
    };

    useEffect(() => {
        axios
          .get("http://localhost:5000/api/NVQT/listNVQLK/")
          .then((res) => {
            setListNhanVien(res.data);
          })
          .catch((err) => {
            console.log(err);
          });

      }, []);

    const onClickEdit = (item) => {
      setNhanVien(item);
      setEditVisible(true);
    };
  
    const onClickAdd = () => {
      setAddVisible(true);
    };

    const onClickDelete = (nv) => {
      axios
        .delete("http://localhost:5000/api/NVQT/xoaNVQLK/" + nv.MaNV)
        .then((response) => {
          console.log(response);
        });
  
      axios
        .post("http://localhost:5000/api/NVQT/listNVQLK", JSON.stringify(info), {
          headers: { "Content-Type": "application/json" },
        })
        .then((res) => {
          setListNhanVien(res.data);
        })
        .catch((err) => {
          console.log(err);
        });
    };
    
    const openNotification = () => {
      notification.open({
        message: 'Chúc mừng!',
        description:
          'Bạn đã xóa tài khoản Nhân Viên Quản Lý Kho thành công',
        onClick: () => {
          console.log('Notification Clicked!');
        },
      });
    }

    const columns = [
      {
        title: "Mã Nhân Viên",
        dataIndex: "MaNV",
        key: "MaNV",
      },
      {
        title: "Họ Tên",
        key: "HoTen",
        dataIndex: "HoTen",
      },
      {
        title: "Ngày sinh",
        dataIndex: "NgaySinh",
        key: "NgaySinh",
        render: (_,record) => {return moment(record.NgaySinh).format("YYYY-MM-DD")}
      },
      {
        title: "Địa chỉ",
        key: "DiaChi",
        dataIndex: "SoNha",
        render: (_,record) => {return <div>{record.SoNha + " " +record.Duong + " Phường " + record.Phuong + " Quận " + record.Quan + " " +record.ThanhPho}</div>}
      },
      {
        title: "Email",
        key: "Email",
        dataIndex: "Email",
      },
      {
        title: "SĐT",
        key: "SDT",
        dataIndex: "SDT",
      },
      {
        title: "Giới tính",
        key: "GioiTinh",
        dataIndex: "GioiTinh",
      },
      {
        title: "Ngày Vào Làm",
        key: "NgayVaoLam",
        dataIndex: "NgayVaoLam",
        render: (_,record) => {return moment(record.NgayVaoLam).format("MM-DD-YYYY")}
      },
      {
        title: "Lương",
        key: "Luong",
        dataIndex: "Luong",
      },
      {
        title: "Hệ Số Lương",
        key: "HeSoLuong",
        dataIndex: "HeSoLuong",
      },
      {
        title: "Hành động",
        key: "action",
        render: (_, record) => (
          <Space size="middle">
            <EditTwoTone
              className="edit-button"
              //onClick={() => onClickEdit(record)}
            />
            <DeleteTwoTone
              className="delete"
              onClick={onClickDelete(record.MaNV)}
              onClick={openNotification}
            />
          </Space>
        ),
      },
    ];

  return (
    <div>
        <div>
      <Layout>
        <Content>
          <Title level={2} classname="titlename">
            Danh sách Nhân Viên Quản Lý Kho
          </Title>
          <Table columns={columns} dataSource={listNhanVien} pagination={false} />
        </Content>
      </Layout>
    </div>

      {/* <EditModal
          key={editVisible}
          visible={editVisible}
          NhanVien={NhanVien}
          setVisibleFalse={setVisibleFalse}
        />
        <AddModal
          key={addVisible}
          visible={addVisible}
          setVisibleFalse={setVisibleFalse}
        /> */}
    </div>
  );
}

export default NVQLK;
